import Image from "./common/Image";
import mhw from "../img/モンハン.webp"

const MHW: React.FC = () => {
    return(
        <div>
            <h1 className="header">MonsterHunter WORLD</h1>
            <Image className="main" src={mhw}/>
        </div>
    )
}

export default MHW;
